import React, { Component } from "react";
import CG from "./components/Goal";
import "./App.css";
import goals from "./assets/goals.png";
import Header from "./components/Header";

class App extends Component {
  render() {
    return (
      <main>
        <Header image={{ src: goals }} />
        <CG title="COURSE GOAL" description="DESCRIPTION">
          <p>123</p>
        </CG>
      </main>
    );
  }
}

export default App;
